		        {
		            // Logout 
		            auth.logout();
		            ic.Initiate_Logout();

		        }
		        else if(edSchedSel)
		        {
		            appEditSched();
		        }
		        else if(schedSetupSel)
		        {
		            setupSched();
		        }
	    	}
    	}
